import React from "react";
import Carousel from "../components/caroussel"

const App = () => {
  const images = ["image1.jpg", "image2.jpg", "image3.jpg"];

  return (
    <div>
      <h1>Mon Carrousel d'Images</h1>
      <Carousel images={images} />
    </div>
  );
};

export default Cross;
